{'entity_id': 'Calanthe', 'entity_type': 'person', 'description': "Calanthe is a queen characterized by her proud demeanor and authoritative presence, involved in important conversations about a cursed individual.<SEP>Calanthe is a queen who acknowledges Geralts contribution and the importance of fulfilling destiny, linking it to her daughter's marriage.<SEP>Calanthe is depicted as a strong and authoritative queen, characterized by her inquisitive nature and engaging presence. She frequently interacts with Geralt, displaying sincerity and laughter, which highlights her emotional depth. Calanthe is also deeply involved in conversations about her past, particularly regarding her husband, King Roegner, and significant incidents that have marked her reign.

Amidst moments of chaos, she showcases her regal demeanor, emotionally interacting with Eist Tuirseach, which reveals a relationship marked by affection. Calanthe is noted for her leadership, as she commands the situation effectively during crises, showing wisdom and generosity in her approach to governance. She emphasizes the importance of political alliances through strategic marriage, reflecting her understanding of the complexities of ruling.

Furthermore, Calanthe participates in dialogues about the destiny of her kingdom and her child's succession, asserting her authority while acknowledging the intricate political landscape she navigates. Despite her powerful position, she experiences vulnerability, as indicated by her eventual fall from the throne during chaos, underscoring the challenges she faces as a ruler. Ultimately, Calanthe embodies the qualities of charm, authority, and resilience as she continues her reign beside the new king of Cintra, striving to maintain stability in her kingdom.<SEP>Calanthe is the queen who asserts her authority over the discussion, displaying a strong-willed and commanding presence.<SEP>Calanthe is the queen, exhibiting authority and decisiveness as she manages the proceedings in the throne room.<SEP>Calanthe is a queen who exhibits strong emotional reactions and authority, showing frustration towards the knights.<SEP>Calanthe is a queen who discusses the nature of power and the dynamics of money and influence in a royal context.<SEP>Calanthe is the queen who acknowledges Geralt's contributions and is involved in the proceedings surrounding Urcheon's vow.<SEP>Calanthe is described as a beautiful queen of Cintra and is portrayed as somewhat reluctant during the gathering.<SEP>Calanthe is the queen of Cintra, described as beautiful but somewhat reluctant to engage fully in the gathering activities.<SEP>Calanthe is a queen who exhibits strong leadership and engages in strategic discussions with Geralt.", 'source_id': 'chunk-a68f8e004ccede485811cb82a36f79b7<SEP>chunk-c1e38840cd678085346222b8bd44e254<SEP>chunk-f52f626bf2f0019c3b7cb0f02de608b2<SEP>chunk-6d2e171e6a2fb2309b20a4108a28c43a<SEP>chunk-e2bcfbbf6693219c6e135a78e128792b<SEP>chunk-8e0bb2355fb88011cbc32713aaaddefc<SEP>chunk-eb48e1b7c88fd45acf0da33c56848a16<SEP>chunk-e340681286c3c6242d847580d40f232b<SEP>chunk-6103804fa3bf5fb6196a4b30dca4238f<SEP>chunk-7f4ca57afa58402ba03fa452e6a79e34<SEP>chunk-bdcf9478a84cf2b82530586584c